



































-- заполним как-нибудь оценки наугад
SELECT gr.id as user_id, FLOOR(RAND() * 3) + 3 as mark, disc.discipline_id as discipline_id  from users gr
left join alp disc on gr.institute_id = disc.institute_id
order by gr.id;

-- обновим средний балл у всех выпусников
UPDATE users u JOIN
(
  SELECT m1.user_id, round(AVG(m1.mark),2) avg_mark
    FROM marks m1 
   GROUP BY m1.user_id
) m 
    ON u.id = m.user_id
   SET u.avg_mark = m.avg_mark;


-- создадим триггеры на изменение оценок - чтобы сразу происходил пересчет средней оценки
DROP TRIGGER IF EXISTS `update_avg_mark_on_insert`;
DELIMITER $$
CREATE TRIGGER `update_avg_mark_on_insert` AFTER INSERT ON `marks`
FOR EACH ROW 
BEGIN
   UPDATE users u set avg_mark = (select round(AVG (mark),2) from marks m where m.user_id = NEW.user_id GROUP BY m.user_id) where u.id = NEW.user_id;
END$$
DELIMITER ;

DROP TRIGGER IF EXISTS `update_avg_mark_on_delete`;
DELIMITER $$
CREATE TRIGGER `update_avg_mark_on_delete` AFTER DELETE ON `marks`
FOR EACH ROW 
BEGIN
   UPDATE users u set avg_mark = (select round(AVG (mark),2) from marks m where m.user_id = OLD.user_id GROUP BY m.user_id) where u.id = OLD.user_id;
END$$
DELIMITER ;

DROP TRIGGER IF EXISTS `update_avg_mark_on_update`;
DELIMITER $$
CREATE TRIGGER `update_avg_mark_on_update` AFTER UPDATE ON `marks`
FOR EACH ROW 
BEGIN
   UPDATE users u set avg_mark = (select round(AVG (mark),2) from marks m where m.user_id = OLD.user_id GROUP BY m.user_id) where u.id = OLD.user_id;
END$$
DELIMITER ;

-- представления
-- 1. рейтинг институтов по среднему баллу выпускников
CREATE OR REPLACE VIEW institutes_rating AS select i.id AS 'id', i.name AS 'Institute', avg_marks.AvgMark as Avg_Mark from institutes i left join (SELECT u.institute_id as 'institute_id', round(avg(avg_mark),2)  as  'AvgMark' from users u
group by u.institute_id) avg_marks on avg_marks.institute_id = i.id
order by Avg_Mark DESC;

-- 2. относительное отклонение среднего балла (выпускник - средний балл - отклонение от среднего по институту в %)
CREATE OR REPLACE VIEW graduates_deviation AS 
select ir.institute, ir.Avg_Mark AS institute_avg_mark, u.id, u.firstname, u.lastname, u.avg_mark AS graduate_avg_mark, ROUND(((u.avg_mark - ir.Avg_Mark)/ir.Avg_Mark)*100,2) AS Deviation FROM users u
left join institutes_rating ir on ir.id = u.institute_id
group BY u.institute_id, u.id
ORDER BY institute DESC, Deviation DESC;
   
CREATE OR REPLACE VIEW top_graduates AS
select institute, id, firstname, lastname,  graduate_avg_mark, MAX(Deviation) AS MAX_deviation FROM graduates_deviation
group by institute
ORDER BY MAX_deviation DESC;
   

